import Axios from 'axios';
import React from 'react';
import {withRouter} from 'react-router-dom';
import App from './App';
import {useState} from "react";
import {useEffect} from "react";

function Profile(props){
    //const [pickupCode, setPickupCode]=usestate(0);
    //const [depositCode, setDepositCode]=usestate(0);
    const [dict,setDict]=useState([])
    const username = props.location.username;
    const [password, setPassword]=useState('');
    const [name, setName]=useState('');
    const [pickupCode, setPickupCode]=useState('');
    const [depositCode, setDepositCode]=useState('');

    useEffect(() => {
        Axios.post("http://localhost:3001/getInfo",
        {username:username}).then((response)=>{
            setDict(response.data);
            console.log(dict);
            setPassword(dict.pwd);
            setName(response.data.customer_name);
            setPickupCode(response.data.pickup_code);
            setDepositCode(response.data.deposit_code);
            console.log(password);
            
            //console.log(depositCode);
        });
    }
        );
    return(
        <div>
            <h1>Get Pickup and Deposit Codes</h1>
                <label>Username: {password}</label>
                <label>Deposit Code: {depositCode}</label>
        </div>
    );
}

export default withRouter(Profile)
